@-moz-document domain("trackthetropics.com") {

body {
    margin: 0 2%;
}

body, td#right-inner, td#right, td#left {
    background: #e2e2e2;
    font-family: 'Open Sans', sans-serif;
}

hr {
    border: 0;
    border: 1px solid #f5f5f5;
    border-style: inset;
}

a {
    font-weight: 300;
    font-style: inherit;
    text-decoration: none;
    transition: 0.3s all;
}
a:hover {
    color: #2c52c1;
    background: #ececec;
}
}
